import OneOfPostPresenter from "./OneOfPostPresenter";
import { withRouter } from "react-router-dom";

export default withRouter(({ match: { params } }) => {
  console.log(params);
  return <OneOfPostPresenter id={params.id} username={params.username} />;
});
